member.summary:
Simple CSV export
Example:
CsvExport myExport = new CsvExport();
  myExport.AddRow();
  myExport.SetValue("Region","New York, USA");
  myExport.SetValue("Sales",100000);
  myExport.SetValue("Date Opened", new DateTime(2003, 12, 31));
  myExport.AddRow();
  myExport.SetValue("Region", "Sydney \"in\" Australia");
  myExport.SetValue("Sales", 50000);
  myExport.SetValue("Date Opened", new DateTime(2005, 1, 1, 9, 30, 0));
Then you can do any of the following output options:
string myCsv = myExport.Export();             to return a single "CSV" string
  myExport.ExportToFile("Somefile.csv");        to create (overwrite) a file.

member.example:
Original: "I want candy and cake."
patterns: "cake", "candy"
result:
    { Token = "I want ", IsMatch = false }
    { Token = "candy", IsMatch = true }
    { Token = " and ", IsMatch = false }
    { Token = "cake", IsMatch = true }
    { Token = ".", IsMatch = false }.
